void DMMAmFmTunerControl_TunerParameters_Free( DMMAmFmTunerControl_TunerParameters *p )
{
if (p == 0)
   return;
   {
      int idx = DSIVectorSize( (*p) ) ;
      while( --idx >= 0 )
      {
         DMMAmFmTunerControl_TunerParameter_Free( &(*p)->data[idx] );
      }
   }
   DSIVectorFree( (*p) );
}

void DSIReadDMMAmFmTunerControl_TunerParameters( DSIStream *stream, DMMAmFmTunerControl_TunerParameters *p )
{
   if( p && stream)
   {
      int size = 0 ;
      DMMAmFmTunerControl_TunerParameters_Free( p );

      DSIRead32( stream, &size );
      if( 0 != size )
      {
         int idx = 0 ;
         DMMAmFmTunerControl_TunerParameters vec = 0 ; 
         DSIVectorAlloc( vec, size );//lint !e449
         if (vec)
         { 
            memset( vec->data, 0, sizeof(vec->data[0]) * size );
            while( idx < vec->size )
            {
               DSIReadDMMAmFmTunerControl_TunerParameter( stream, &vec->data[idx] ) ;
               idx++;
            }
         }
         *p = vec ;
      }
   }
}

void DSIWriteDMMAmFmTunerControl_TunerParameters( DSIStream *stream, const DMMAmFmTunerControl_TunerParameters *p )
{
   if (!stream)
      return;
   if( !p || !(*p) || !(*p)->size )
   {
      static const int size0 = 0 ;
      DSIWrite32( stream, &size0 );
   }
   else
   {
      int idx = 0 ;
      const DMMAmFmTunerControl_TunerParameters vec = *p ;
      DSIWrite32( stream, &vec->size );
      while( idx < vec->size )
      {
         DSIWriteDMMAmFmTunerControl_TunerParameter( stream, &vec->data[idx] ) ;
         idx++;
      }
   }
}



